import React from "react";
import "./AddNewExpensesButton.css";
const AddExpensesButton =(props) =>{
    const newButtonAddExpense =(e)=>{
        e.preventDefault();
        console.log("click");
        props.newVar = true;
    }


return(
    <>
    <button 
    type="submit"
    onClick={newButtonAddExpense}
    className="new-expenses"> 
    Add New Expenses
    </button>
    
    </>
)

}
export default AddExpensesButton;
